// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract loop {
    function forLoop() public pure returns(uint) {
        uint sum = 0;
        for (uint i = 1; i< 6; i++) sum +=i;
        return sum; // 15
    }

    function forLoop1() public pure returns(uint) {
        uint sum = 0;
        uint i = 1;
        for ( ; ; ) {
            if (i > 5) break;
            sum +=i;
            i++;
        }
        return sum; // 15
    }
}

